import {Nav} from "react-bootstrap";
import React, {useState} from "react";

const TopBar = (props) => {
    return <Nav activeKey="/styleConfig" 
            onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
        >
            <Nav.Item>
                <Nav.Link href="/styleConfig">Style Config</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link href="/storeConfig">Store Config</Nav.Link>
            </Nav.Item>
        </Nav>
}

export default TopBar
